 The entity is 7 bits long. The arraybuffer will be 1 byte long for every 8 entities.

Here is a simple example of how you can achieve this in JavaScript:
```javascript
function packEntities(entities) {
  const buffer = new ArrayBuffer(entities.length);
  const view = new Uint8Array(buffer);

  let byteIndex = 0;
  let bitIndex = 0;

  for (let i = 0; i < entities.length; i++) {
    const entity = entities[i];
    const id = entity.id;
    const size = entity.size;

    // Write id (4 bits)
    view[byteIndex] |= (id & 0xF) << bitIndex;
    bitIndex += 4;
    if (bitIndex >= 8) {
      bitIndex -= 8;
      byteIndex++;
    }

    // Write size (3 bits)
    view[byteIndex] |= (size & 0x7) << bitIndex;
    bitIndex += 3;
    if (bitIndex >= 8) {
      bitIndex -= 8;
      byteIndex++;
    }
  }

  return buffer;
}

function unpackEntities(buffer) {
  const view = new Uint8Array(buffer);
  const entities = [];

  let byteIndex = 0;
  let bitIndex = 0;

  while (byteIndex < view.length) {
    const id = (view[byteIndex] >> bitIndex) & 0xF;
    bitIndex += 4;
    if (bitIndex >= 8) {
      bitIndex -= 8;
      byteIndex++;
    }

    const size = (view[byteIndex] >> bitIndex) & 0x7;
    bitIndex += 3;
    if (bitIndex >= 8) {
      bitIndex -= 8;
      byteIndex++;
    }

    entities.push({ id, size });
  }

  return entities;
}
```
